import React, { Component } from 'react';

/* JS Imports */
import LandingPage from './pages/landingPage';

/* CSS Imports */
import './App.css';


const App = () => {
  return (
    <div className="App">
      <BrowserRouter>
        <Route path ="/" exact component={LandingPage} />
      </BrowserRouter>
    </div>
  );
}

export default App;
